import React, {Component} from "react";


class ProfileMain extends Component {
    constructor(props) {
        super(props);
    }


    render() {
        return (
            <React.Fragment>
                <div className="backgroundContainer position-fixed mt-5">
                    <div className="row text-center justify-content-end mt-3">
                        <div className="row">
                            <div className="col-8 text-left">
                                <h4>Sign in!</h4>
                            </div>
                            <div className="col-4">
                                <button onClick={this.props.close} className="btn btn-light material-icons float-right">
                                    close
                                </button>
                            </div>
                        </div>
                        <div className="container">
                            <div className="row">
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default ProfileMain;
